ARCHITECTURE rtl OF filter_tb IS
  -- -------------------------------------------------------------
  -- Component Declarations
  -- -------------------------------------------------------------
  COMPONENT filter_serial
   PORT( clk                             :   IN    std_logic; 
         clk_enable                      :   IN    std_logic; 
         syn_rst                         :   IN    std_logic; 
         filter_in                       :   IN    std_logic_vector(15 DOWNTO 0); -- sfix16_En15
         filter_out                      :   OUT   std_logic_vector(32 DOWNTO 0)  -- sfix33_En31
         );
  END COMPONENT;

  -- -------------------------------------------------------------
  -- Component Configuration Statements
  -- -------------------------------------------------------------
  FOR ALL : filter_serial
    USE ENTITY work.filter_serial(rtl);

  -- Constants
  CONSTANT clk_high                         : time := 5 ns;
  CONSTANT clk_low                          : time := 5 ns;
  CONSTANT clk_period                       : time := 10 ns;
  CONSTANT clk_hold                         : time := 2 ns;
  CONSTANT MAX_TIMEOUT                    : integer := 37; -- uint32
  CONSTANT MAX_ERROR_COUNT                : integer := 3114; -- uint32


  -- Signals
  SIGNAL clk                              : std_logic; -- boolean
  SIGNAL clk_enable                       : std_logic; -- boolean
  SIGNAL syn_rst                          : std_logic; -- boolean
  SIGNAL filter_in                        : std_logic_vector(15 DOWNTO 0); -- sfix16_En15
  SIGNAL filter_out                       : std_logic_vector(32 DOWNTO 0); -- sfix33_En31

  SIGNAL tb_enb                           : std_logic; -- boolean
  SIGNAL srcDone                          : std_logic; -- boolean
  SIGNAL snkDone                          : std_logic; -- boolean
  SIGNAL testFailure                      : std_logic; -- boolean
  SIGNAL tbenb_dly                        : std_logic; -- boolean
  SIGNAL counter                          : unsigned(2 DOWNTO 0); -- ufix3
  SIGNAL phase_1                          : std_logic; -- boolean
  SIGNAL rdEnb_phase_1                    : std_logic; -- boolean
  SIGNAL filter_in_data_log_rdenb         : std_logic; -- boolean
  SIGNAL filter_in_data_log_addr          : unsigned(11 DOWNTO 0); -- ufix12
  SIGNAL filter_in_data_log_done          : std_logic; -- boolean
  SIGNAL holdData_filter_in               : std_logic_vector(15 DOWNTO 0); -- sfix16_En15
  SIGNAL filter_out_testFailure           : std_logic; -- boolean
  SIGNAL filter_out_timeout               : integer; -- uint32
  SIGNAL filter_out_errCnt                : integer; -- uint32
  SIGNAL delayLine_out                    : std_logic; -- boolean
  SIGNAL expected_ce_out                  : std_logic; -- boolean
  SIGNAL int_delay_pipe                   : std_logic_vector(0 TO 12); -- boolean
  SIGNAL filter_out_rdenb                 : std_logic; -- boolean
  SIGNAL filter_out_addr                  : unsigned(11 DOWNTO 0); -- ufix12
  SIGNAL filter_out_done                  : std_logic; -- boolean
  SIGNAL filter_out_ref                   : std_logic_vector(32 DOWNTO 0); -- sfix33_En31
  SIGNAL filter_out_dataTable             : std_logic_vector(32 DOWNTO 0); -- sfix33_En31
  SIGNAL filter_out_refTmp                : std_logic_vector(32 DOWNTO 0); -- sfix33_En31
  SIGNAL regout                           : std_logic_vector(32 DOWNTO 0); -- sfix33_En31
  SIGNAL check1_Done                      : std_logic; -- boolean


BEGIN
  -- Component Instances
  u_filter_serial: filter_serial
    PORT MAP (
              clk                              => clk,
              clk_enable                       => clk_enable,
              syn_rst                          => syn_rst,
              filter_in                        => filter_in,
              filter_out                       => filter_out      );


  -- Block Statements
  -- -------------------------------------------------------------
  -- Driving the test bench enable
  -- -------------------------------------------------------------

  tb_enb <= '0' WHEN syn_rst = '1' ELSE 
            '1' WHEN snkDone = '0' ELSE 
            '0' AFTER clk_period * 2;

  completed_msg: PROCESS (clk, syn_rst)
  BEGIN
    IF (syn_rst = '1') THEN 
       -- Nothing to reset here.
    ELSIF clk'event AND clk = '1' THEN
      IF snkDone='1' THEN
        IF (testFailure = '0') THEN
              ASSERT FALSE
                REPORT "**************TEST COMPLETED (PASSED)**************"
                SEVERITY NOTE;
        ELSE
              ASSERT FALSE
                REPORT "**************TEST COMPLETED (FAILED)**************"
                SEVERITY NOTE;
        END IF;
      END IF;
    END IF;
  END PROCESS completed_msg;

  -- -------------------------------------------------------------
  -- System Clock (fast clock) and reset
  -- -------------------------------------------------------------

  clk_gen: PROCESS
  BEGIN
    clk <= '1';
    WAIT FOR clk_high;
    clk <= '0';
    WAIT FOR clk_low;
    IF snkDone = '1' THEN
      clk <= '1';
      WAIT FOR clk_high;
      clk <= '0';
      WAIT FOR clk_low;
      WAIT;
    END IF;
  END PROCESS clk_gen;

  syn_rst_gen: PROCESS
  BEGIN
    syn_rst <= '1';
    WAIT FOR clk_period * 2;
    WAIT UNTIL clk'event AND clk = '1';
    WAIT FOR clk_hold;
    syn_rst <= '0';
    WAIT;
  END PROCESS syn_rst_gen;

  -- -------------------------------------------------------------
  -- Global clock enable
  -- -------------------------------------------------------------

  tb_enb_delay : PROCESS (clk)
  BEGIN
    IF clk'event AND clk = '1' THEN
      IF syn_rst = '1' THEN
        tbenb_dly <= '0';
      ELSIF tb_enb = '1' THEN
        tbenb_dly <= tb_enb;
      END IF;
    END IF; 
  END PROCESS tb_enb_delay;

  clk_enable <= tbenb_dly AFTER clk_hold WHEN snkDone = '0' ELSE
                '0' AFTER clk_hold;

  -- -------------------------------------------------------------
  -- Slow Clock (clkenb)
  -- -------------------------------------------------------------

  slow_clock_enable : PROCESS (clk)
  BEGIN
    IF clk'event AND clk = '1' THEN
      IF syn_rst = '1' THEN
        counter <= to_unsigned(1, 3);
      ELSIF tbenb_dly = '1' THEN
        IF counter = to_unsigned(5, 3) THEN
          counter <= to_unsigned(0, 3);
        ELSE
          counter <= counter + 1;
        END IF;
      END IF;
    END IF; 
  END PROCESS slow_clock_enable;

  phase_1 <= '1' WHEN counter = to_unsigned(1, 3) AND tbenb_dly = '1' ELSE '0';

  rdEnb_phase_1 <= phase_1;

  -- -------------------------------------------------------------
  -- Read the data and transmit it to the DUT
  -- -------------------------------------------------------------

  filter_in_data_log_procedure (
    clk       => clk,
    reset     => syn_rst,
    rdenb     => filter_in_data_log_rdenb,
    addr      => filter_in_data_log_addr,
    done      => filter_in_data_log_done);

  filter_in_data_log_rdenb <= rdEnb_phase_1;

  stimuli_filter_in_data_log_reg: PROCESS(clk, syn_rst)
  BEGIN
   IF syn_rst = '1' THEN
      holdData_filter_in <= ( OTHERS => 'X');
   ELSIF clk'event AND clk = '1' THEN
        holdData_filter_in <= filter_in_data_log_force(TO_INTEGER(filter_in_data_log_addr));
   END IF;
  END PROCESS stimuli_filter_in_data_log_reg;

  stimuli_filter_in_data_log : PROCESS(filter_in_data_log_addr, filter_in_data_log_rdenb)
  BEGIN
    IF filter_in_data_log_rdenb = '1' THEN
      filter_in <= filter_in_data_log_force(TO_INTEGER(filter_in_data_log_addr)) AFTER clk_hold;
    ELSE
      filter_in <= holdData_filter_in AFTER clk_hold;
    END IF;
  END PROCESS stimuli_filter_in_data_log;

  -- -------------------------------------------------------------
  -- Create done signal for Input data
  -- -------------------------------------------------------------

  srcDone <= filter_in_data_log_done;


  ceout_delayLine : PROCESS (clk)
  BEGIN
    IF clk'event AND clk = '1' THEN
      IF syn_rst = '1' THEN
        int_delay_pipe(0 TO 12) <= (OTHERS => '0');
      ELSIF clk_enable = '1' THEN
                int_delay_pipe(0) <= rdEnb_phase_1;
        int_delay_pipe(1 TO 12) <= int_delay_pipe(0 TO 11);
      END IF;
    END IF; 
  END PROCESS ceout_delayLine;

  delayLine_out <= int_delay_pipe(12);

  expected_ce_out <=  delayLine_out AND clk_enable;

  -- -------------------------------------------------------------
  --  Checker: Checking the data received from the DUT.
  -- -------------------------------------------------------------

  filter_out_procedure (
    clk       => clk,
    reset     => syn_rst,
    rdenb     => filter_out_rdenb,
    addr      => filter_out_addr,
    done      => filter_out_done);

  filter_out_rdenb <= expected_ce_out;

filter_out_dataTable <= filter_out_expected(TO_INTEGER(filter_out_addr)) AFTER clk_hold;
-- ---- Bypass Register ----
  DataHoldRegister_temp_process2 : PROCESS (clk)
  BEGIN
    IF clk'event AND clk = '1' THEN
      IF syn_rst = '1' THEN
        regout <= (OTHERS => '0');
      ELSIF expected_ce_out = '1' THEN
        regout <= (filter_out_dataTable);
      END IF;
    END IF;
  END PROCESS DataHoldRegister_temp_process2;

  filter_out_refTmp <= (filter_out_dataTable) WHEN ( expected_ce_out = '1' ) ELSE
                       (regout);


  filter_out_ref <= std_logic_vector(filter_out_refTmp);

  checker_1: PROCESS(clk, syn_rst)
  BEGIN
    IF syn_rst = '1' THEN
      filter_out_timeout <= 0;
      filter_out_errCnt <= 0;
      filter_out_testFailure <= '0';
    ELSIF clk'event and clk ='1' THEN
      IF filter_out_rdenb = '1' THEN
        filter_out_timeout <= 0;
        IF (Is_X(filter_out) OR abs(signed(filter_out)  - signed(filter_out_expected(TO_INTEGER(filter_out_addr)))) > 15) THEN
          filter_out_errCnt <= filter_out_errCnt + 1;
          filter_out_testFailure <= '1';
          ASSERT FALSE 
            REPORT "Error in filter_out: Expected " 
            & to_hex(filter_out_expected(TO_INTEGER(filter_out_addr)))
            & " Actual "
            & to_hex(filter_out)
            SEVERITY ERROR;
          IF filter_out_errCnt >= MAX_ERROR_COUNT THEN
            ASSERT FALSE
              REPORT "Number of errors have exceeded the maximum error"
              SEVERITY Warning;
          END IF;
        END IF;
      ELSIF filter_out_timeout > MAX_TIMEOUT AND filter_out_rdenb = '1' THEN
        filter_out_errCnt <= filter_out_errCnt + 1;
        filter_out_testFailure <= '1';
        ASSERT FALSE
          REPORT "Timeout: Data was not received after timeout."
          SEVERITY FAILURE ;
      ELSIF filter_out_rdenb = '1' THEN
        filter_out_timeout <= filter_out_timeout + 1 ;
      END IF;
    END IF;
  END PROCESS checker_1;

  checkDone_1: PROCESS(clk, syn_rst)
  BEGIN
    IF syn_rst = '1' THEN
      check1_Done <= '0';
    ELSIF clk'event and clk ='1' THEN
      IF check1_Done = '0' AND filter_out_done = '1' AND filter_out_rdenb = '1' THEN
        check1_Done <= '1';
      END IF;
    END IF;
  END PROCESS checkDone_1;
  -- -------------------------------------------------------------
  -- Create done and test failure signal for output data
  -- -------------------------------------------------------------

  snkDone <= check1_Done;

  testFailure <= filter_out_testFailure;

  -- Assignment Statements



END rtl;
